                   "ATK",
                   "RTK",
                   "Fuel (in liters)",
                   "Flight Distance (in km)",
                   "Departures",
                   "Payload (in km \u2013 Paid)",
                   "Payload (in km \u2013 Free)",
                   "Payload (in km \u2013 Mail)",
                   "Seats",
